      function pysudakov(st,xm,id,itype,xmpart)
      implicit none
      real*8 pysudakov,st,xm,xmpart(21)
      integer id,itype
      real*8 tmp,cstmin,cxmmin,cxmmax
      real*8 mcmass(21)
      integer i,id0,listmin,lixmmin,lixmmax
      logical firsttime,check,T,F,grid(21)
      parameter (T=.true.)
      parameter (F=.false.)
      real*8 stlow,stupp,xmlow,xmupp
      parameter (stlow= 0.10000000D+01,stupp= 0.70000000D+04)
      parameter (xmlow= 0.10000000D+01,xmupp= 0.70000000D+04)
      real*8 cstlow,cstupp,cxmlow,cxmupp
      common/cstxmbds/cstlow,cstupp,cxmlow,cxmupp
      real*8 pysudakov_1_1
      real*8 pysudakov_2_1
      real*8 pysudakov_3_1
      real*8 pysudakov_4_1
      real*8 pysudakov_5_1
      real*8 pysudakov_6_1
      real*8 pysudakov_21_1
      real*8 pysudakov_1_2
      real*8 pysudakov_2_2
      real*8 pysudakov_3_2
      real*8 pysudakov_4_2
      real*8 pysudakov_5_2
      real*8 pysudakov_6_2
      real*8 pysudakov_21_2
      real*8 pysudakov_1_3
      real*8 pysudakov_2_3
      real*8 pysudakov_3_3
      real*8 pysudakov_4_3
      real*8 pysudakov_5_3
      real*8 pysudakov_6_3
      real*8 pysudakov_21_3
      real*8 pysudakov_1_4
      real*8 pysudakov_2_4
      real*8 pysudakov_3_4
      real*8 pysudakov_4_4
      real*8 pysudakov_5_4
      real*8 pysudakov_6_4
      real*8 pysudakov_21_4
      data mcmass/
     # 0.33000000D+00, 0.33000000D+00, 0.50000000D+00, 0.15000000D+01,
     # 0.48000000D+01, 0.00000000D+00, 0.00000000D+00, 0.00000000D+00,
     # 0.00000000D+00, 0.00000000D+00, 0.51099893D-03, 0.00000000D+00,
     # 0.10565837D+00, 0.00000000D+00, 0.17768200D+01, 0.00000000D+00,
     # 0.00000000D+00, 0.00000000D+00, 0.00000000D+00, 0.00000000D+00,
     # 0.00000000D+00/
      data grid/T,T,T,T,T,T,F,F,F,F,F,F,F,F,F,F,F,F,F,F,T/
      data firsttime/.true./
      save
c
      if(firsttime)then
        firsttime=.false.
        check=.false.
        do i=1,21
          if(grid(i))check=check .or.
     #      abs(xmpart(i)-mcmass(i)).gt.1.d-6
        enddo
        if(check)then
          write(*,*)'input masses inconsistent'
     #              //' with grid setup'
          stop
        endif
        cstlow=stlow
        cstupp=stupp
        cxmlow=xmlow
        cxmupp=xmupp
        listmin=0
        lixmmin=0
        lixmmax=0
        cstmin=0.d0
        cxmmin=0.d0
        cxmmax=0.d0
      endif
      if(st.gt.stupp)then
        write(*,*)'st is too large:',st
        write(*,*)'largest value allowed is:',stupp
        stop
      endif
      if(st.lt.stlow)then
        cstmin=cstmin+1.d0
        if(log10(cstmin).gt.listmin)then
          write(*,*)'=========================='
          write(*,*)'Warning in pysudakov:'
          write(*,*)'  st<stlow more than 10**',
     #      listmin,' times'
          write(*,*)'=========================='
          listmin=listmin+1
        endif
      endif
      if(xm.lt.xmlow)then
        cxmmin=cxmmin+1.d0
        if(log10(cxmmin).gt.lixmmin)then
          write(*,*)'=========================='
          write(*,*)'Warning in pysudakov:'
          write(*,*)'xm<xmlow more than 10**',
     #      lixmmin,' times'
          write(*,*)'=========================='
          lixmmin=lixmmin+1
        endif
      endif
      if(xm.gt.xmupp)then
        cxmmax=cxmmax+1.d0
        if(log10(cxmmax).gt.lixmmax)then
          write(*,*)'=========================='
          write(*,*)'Warning in pysudakov:'
          write(*,*)'xm>xmupp more than 10**',
     #      lixmmax,' times'
          write(*,*)'=========================='
          lixmmax=lixmmax+1
        endif
      endif
      id0=abs(id)
      if(itype.eq.1)then
        if(id0.eq.1)then
          tmp=pysudakov_1_1(st,xm)
        elseif(id0.eq.2)then
          tmp=pysudakov_2_1(st,xm)
        elseif(id0.eq.3)then
          tmp=pysudakov_3_1(st,xm)
        elseif(id0.eq.4)then
          tmp=pysudakov_4_1(st,xm)
        elseif(id0.eq.5)then
          tmp=pysudakov_5_1(st,xm)
        elseif(id0.eq.6)then
          tmp=pysudakov_6_1(st,xm)
        elseif(id0.eq.21)then
          tmp=pysudakov_21_1(st,xm)
        else
          write(*,*)'unknown parton ID:',id
          stop
        endif
      elseif(itype.eq.2)then
        if(id0.eq.1)then
          tmp=pysudakov_1_2(st,xm)
        elseif(id0.eq.2)then
          tmp=pysudakov_2_2(st,xm)
        elseif(id0.eq.3)then
          tmp=pysudakov_3_2(st,xm)
        elseif(id0.eq.4)then
          tmp=pysudakov_4_2(st,xm)
        elseif(id0.eq.5)then
          tmp=pysudakov_5_2(st,xm)
        elseif(id0.eq.6)then
          tmp=pysudakov_6_2(st,xm)
        elseif(id0.eq.21)then
          tmp=pysudakov_21_2(st,xm)
        else
          write(*,*)'unknown parton ID:',id
          stop
        endif
      elseif(itype.eq.3)then
        if(id0.eq.1)then
          tmp=pysudakov_1_3(st,xm)
        elseif(id0.eq.2)then
          tmp=pysudakov_2_3(st,xm)
        elseif(id0.eq.3)then
          tmp=pysudakov_3_3(st,xm)
        elseif(id0.eq.4)then
          tmp=pysudakov_4_3(st,xm)
        elseif(id0.eq.5)then
          tmp=pysudakov_5_3(st,xm)
        elseif(id0.eq.6)then
          tmp=pysudakov_6_3(st,xm)
        elseif(id0.eq.21)then
          tmp=pysudakov_21_3(st,xm)
        else
          write(*,*)'unknown parton ID:',id
          stop
        endif
      elseif(itype.eq.4)then
        if(id0.eq.1)then
          tmp=pysudakov_1_4(st,xm)
        elseif(id0.eq.2)then
          tmp=pysudakov_2_4(st,xm)
        elseif(id0.eq.3)then
          tmp=pysudakov_3_4(st,xm)
        elseif(id0.eq.4)then
          tmp=pysudakov_4_4(st,xm)
        elseif(id0.eq.5)then
          tmp=pysudakov_5_4(st,xm)
        elseif(id0.eq.6)then
          tmp=pysudakov_6_4(st,xm)
        elseif(id0.eq.21)then
          tmp=pysudakov_21_4(st,xm)
        else
          write(*,*)'unknown parton ID:',id
          stop
        endif
      else
        write(*,*)'unknown type:',itype
        stop
      endif
      pysudakov=tmp
      return
      end
